import React from 'react';

const LeftMenu = () => {
  return (
    <aside id="sidebar-wrapper">
      <div className="sidebar-brand">
        <a href="/dashboard">
          <img
            alt="image"
            src="/assets/img/logo.png"
            className="header-logo"
            style={{ width: '43px', height: 'auto' }}
          />
          <span className="logo-name" style={{ color: 'rgb(52, 52, 151)', fontFamily: "'Georgia', sans-serif" }}>
            Nixcel
          </span>
        </a>
      </div>
      <ul className="sidebar-menu">
        <li className="menu-header"></li>
        <li className="dropdown active" style={{ marginTop: '5px' }}>
          <a href="/dashboard" className="nav-link" style={{ color: 'black' }}>
            <i data-feather="monitor"></i>
            <span>Dashboard</span>
          </a>
        </li>
        {/* Add your other menu items here */}
      </ul>
    </aside>
  );
};

export default LeftMenu;
